// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./UserRegister.sol";
import "./FileRegister.sol";

contract AccessControl {

    struct UserHasFile {
        address userAccount;       // User account
        string ipfsCID;            // ipfsCID 
        string encSymmetricKey;    // Key used for the file encryption
        string[] permissions;      // It can be: delete, update, share
    }

    struct ResultAction {
        bool success;
        FileRegister.File[] files;
    }
    struct ResultActionStringArray {
        bool success;
        string[] permissions;
    }
    struct ResultActionString {
        bool success;
        string encSymmetricKey;
    }

    UserHasFile[] private userHasFile;  // Not using map because solity doesn't accept structs in keys and a map of this would only make sense if userAccound and ipfsCID could simultaneously be considered keys
    FileRegister fileRegister;

    constructor(address fileRegisterContract) {
        fileRegister = FileRegister(fileRegisterContract);
    }

    function addUserHasFile (UserRegister.User memory user, FileRegister.File memory file, string memory encSymmetricKey, string[] memory permissions) private {
        UserHasFile memory userFileData = UserHasFile({
            userAccount: user.account,
            ipfsCID: file.ipfsCID,
            encSymmetricKey: encSymmetricKey,
            permissions: permissions
        });
        userHasFile.push(userFileData);
    }

    // Upload a file in the system (associates the file to the user, with the given permissions, and adds to the file map)
    function uploadFile(UserRegister.User memory user, FileRegister.File memory file, string memory encSymmetricKey) public {
        bool isUserAssociatedWithFile = userAssociatedWithFile(user, file);
        if (isUserAssociatedWithFile) {
            return; // failed in the upload
        }

        // Adds the association with the given permissions
        string[] memory permissions = new string[](3); // By default these are the permissions of the owner
        permissions[0] = "download";
        permissions[1] = "delete";
        permissions[2] = "share";
        addUserHasFile(user, file, encSymmetricKey, permissions);        

        // Adds the file to the fileRegister table
        fileRegister.addFile(file);
    }

    // Shares the file with the user: 
    function shareFile(UserRegister.User memory user, FileRegister.File memory file, string memory encSymmetricKey, string[] memory permissions) public {
        bool isUserAssociatedWithFile = userAssociatedWithFile(user, file);
        if (isUserAssociatedWithFile) {
            return;
        }

        // Associates the user with the file given the permissions
        addUserHasFile(user, file, encSymmetricKey, permissions);        
    }

    // Updates the permissions a user has over a file
    function updateUserFilePermissions(UserRegister.User memory user, FileRegister.File memory file, string[] memory permissions) public {
        for (uint256 i=0; i<userHasFile.length; i++) {
            if (isKeyEqual(user.account, userHasFile[i].userAccount, file.ipfsCID, userHasFile[i].ipfsCID)) {
                userHasFile[i].permissions = permissions;
                return;
            }
        }
    }

    // Returns the encrypted symmetric key of a given user and file 
    function getEncSymmetricKeyFileUser (UserRegister.User memory user, FileRegister.File memory file) public view returns (ResultActionString memory) {
        for (uint256 i=0; i<userHasFile.length; i++) {
            if (isKeyEqual(user.account, userHasFile[i].userAccount, file.ipfsCID, userHasFile[i].ipfsCID)) {
                return ResultActionString(true, userHasFile[i].encSymmetricKey);
            }
        }
        return ResultActionString(false, "");
    }

    // Returns the permissions of a given user over a given file
    function getPermissionsOverFile (UserRegister.User memory user, FileRegister.File memory file) public view returns (ResultActionStringArray memory) {
        for (uint256 i=0; i<userHasFile.length; i++) {
            if (isKeyEqual(user.account, userHasFile[i].userAccount, file.ipfsCID, userHasFile[i].ipfsCID)) {
                return ResultActionStringArray(true, userHasFile[i].permissions);
            }
        }
        return ResultActionStringArray(false, new string[](0));
    }

    // Returns the files of a giving user
    function getUserFiles(address account) public view returns (ResultAction memory) {
        // Stores the users' files
        FileRegister.File[] memory userFilesResult = new FileRegister.File[](userHasFile.length);
        uint resultIndex = 0;
        for (uint i=0; i<userHasFile.length; i++) {
            if (userHasFile[i].userAccount == account) { // Looks for the files the user is associated with 
                string memory fileIpfsCIDUser = userHasFile[i].ipfsCID;
                FileRegister.ResultAction memory result = fileRegister.getFileByIpfsCID(fileIpfsCIDUser); // Gets the file having the IPFS CID
                FileRegister.File memory fileUser = result.file;
                // Stores the file in the array to be returned
                userFilesResult[resultIndex] = fileUser;
                resultIndex++;
            }
        }
        // Resize the result array to remove unused elements
        assembly {
            mstore(userFilesResult, resultIndex)
        }
        // Returns accordingly
        if (resultIndex != 0) {
            return ResultAction(true, userFilesResult);
        } else {
            return ResultAction(false, userFilesResult);
        }
    }

    // Sees if a user is already associated with a file
    function userAssociatedWithFile(UserRegister.User memory user, FileRegister.File memory file) public view returns (bool) {
        for (uint256 i=0; i<userHasFile.length; i++) {
            if (isKeyEqual(user.account, userHasFile[i].userAccount, file.ipfsCID, userHasFile[i].ipfsCID)) {
                return true;
            }
        }
        return false;
    }

    // Sees if the ipfsCID and the account (primary keys) are the same as the inputs 
    function isKeyEqual(address accountInput, address accountList, string memory ipfsCIDInput, string memory ipfsCIDList) public pure returns (bool){
        return (accountList == accountInput) && (keccak256(abi.encodePacked(ipfsCIDList)) == keccak256(abi.encodePacked(ipfsCIDInput)));
    }
}

contracts/FileRegister.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FileRegister {

    struct File {
        string ipfsCID;            // CID from IPFS (hash) - Unique
        string fileName;           // File Name - cannot be repeated
        address owner;             // The owner - who uploaded the file
        string fileType;           // Image or file
        string iv;                 // Initialization Vector for AES (used in file encryption and decryption with symmetric key)
    }
    struct ResultAction {
        bool success;
        FileRegister.File file;
    }

    mapping(string => File) private files;  // Key: ipfsCID

    // Create a file (Upload)
    function addFile(File memory file) public {
        files[file.ipfsCID] = file; 
    }

    // Gets a file having the files' IPFS CID
    function getFileByIpfsCID(string memory fileIpfsCid) public view returns (ResultAction memory) {
        if (bytes(files[fileIpfsCid].fileName).length > 0) {
            return ResultAction(true, files[fileIpfsCid]);       
        } else {
            return ResultAction(false, File("", "", address(0), "", ""));       
        }
    }

}

contracts/UserRegister.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UserRegister {
    
    struct User {
        address account;           // Address Account in MetaMask - Unique
        string userName;           // Name of the user - unique
        string publicKey;          // User's public key
        string privateKey;         // User's private key
    }

    struct ResultAction {
        bool success;
        User user;
    }

    mapping(address => User) private users;                  // Key: account 
    mapping(string => User) private usersByName;             // Same information as the map "users" but with the name being the key: helps in the method: getUserByUserName 
    mapping(string => bool) private userNameExists;
    event ResultUser(bool success, User user);

    // Create a new user by adding him to the blockchain
    function userRegistered(User memory user) public {
        // Checks if the user is elegible to register
        if (canRegister(user)) {
            users[user.account] = User(user.account, user.userName, user.publicKey, user.privateKey);
            usersByName[user.userName] = User(user.account, user.userName, user.publicKey, user.privateKey);
            userNameExists[user.userName] = true;
        } 
    }

    // Gets the information of a given user. If the user doesn't exist it returns an empty user.
    function getUser(address account) public view returns (ResultAction memory) {
        if (users[account].account != address(0)) {
            return ResultAction(true, users[account]);
        } else {
            return ResultAction(false, User(address(0), "", "", ""));
        }
    }

    // Gets a user having the users' userName
    function getUserByUserName(string memory userName) public view returns (ResultAction memory) {
        if (bytes(usersByName[userName].userName).length > 0) {
            return ResultAction(true, usersByName[userName]);       
        } else {
            return ResultAction(false, User(address(0), "", "", ""));       
        }

    }

    // Checks if the user is elegible to register
    function canRegister(User memory user) public view returns (bool) {
        if (existingAddress(user.account) || existingUserName(user.userName)) {
            return false;
        }
        return true;        
    }

    // Verifies if the address exists (if the user already exists)
    function existingAddress(address account) public view returns (bool) {
        if (users[account].account != address(0)) {
            return true;
        }
        return false;
    }

    // Verifies if the username is taken
    function existingUserName(string memory userName) public view returns (bool) {
        return userNameExists[userName];
    }
}

